import { Link } from 'react-router-dom'
import "../Styles/CadastroCard.css"

export default function CadastroCard (props) {
    return(
        <Link to="/duxux/cadastro" className='link'>
            <div>
                <h1>
                    {props.title}
                </h1>
                <p>
                    {props.description}
                </p>
            </div>
        </Link>
    )
}
